			$('#loading').css('display', 'inline');
			$("html, body").animate({ scrollTop: $("#post-row").offset().top - 60 }, "slow");
		  $scope.paginaAtual++
		  $scope.ultimosPosts = getPosts($scope.paginaAtual);
